

CREATE TABLE Employees
(
    EmployeeID INTEGER PRIMARY KEY AUTO_INCREMENT,
    LastName VARCHAR(15) NOT NULL,
    FirstName VARCHAR(15) NOT NULL,
    Branch INTEGER DEFAULT 1,
    BirthDate DATETIME,
    Photo VARCHAR(25),
    Notes VARCHAR(1024)
);

truncate table Employees;
ALTER TABLE Employees modify column Photo VARCHAR(25)

CREATE TABLE Branch (
     BranchID INTEGER PRIMARY KEY AUTO_INCREMENT,
     Name VARCHAR(25),
     Office VARCHAR(15),
     Address VARCHAR(35),
     OpenDate DATETIME
);

ALTER TABLE Employees
ADD CONSTRAINT fk_Employee_Branch
FOREIGN Key(branch)
REFERENCES Branch(BranchID);

DROP TABLE ACCOUNT_TYPE;
CREATE TABLE AccountType (
   Name VARCHAR(25) PRIMARY KEY
);
INSERT INTO AccountType (Name) VALUES('CHECKING');
INSERT INTO AccountType (Name) VALUES('SAVINGS');
INSERT INTO AccountType (Name) VALUES('LOAN');

ALTER TABLE Account
ADD CONSTRAINT fk_Account_AcctType
FOREIGN Key(AccountType)
REFERENCES ACCOUNT_TYPE(Name);

